import React from 'react'
import {Collapse} from 'react-collapse';

const Collaps = () => {
    return (
        <Collapse isOpened={true}>
        <p>Paragraph of text</p>
        <p>Another paragraph is also OK</p>
        <p>Images and any other content are ok too</p>
        </Collapse>
      );
}

export default Collaps
